SELECT L_AIRPORT_SEQ_ID.Description, L_AIRPORT_SEQ_ID.Code, DENSE_RANK() OVER (PARTITION BY L_AIRPORT_SEQ_ID.Code ORDER BY L_AIRPORT_SEQ_ID.Code) AS win_2, DENSE_RANK() OVER (PARTITION BY L_AIRPORT_SEQ_ID.Description ORDER BY L_AIRPORT_SEQ_ID.Description) AS win_3, ROW_NUMBER() OVER (PARTITION BY L_AIRPORT_SEQ_ID.Description ORDER BY L_AIRPORT_SEQ_ID.Description) AS win_4, ROW_NUMBER() OVER (PARTITION BY L_AIRPORT_SEQ_ID.Description ORDER BY L_AIRPORT_SEQ_ID.Description) AS win_5 FROM L_AIRPORT_SEQ_ID WHERE L_AIRPORT_SEQ_ID.Description != ''